7f2ba1fc-8245-41f0-8040-bff45016dd73	scripting	[Shell Scripting สำหรับ Security] Code Example (bash)\n#!/bin/bash\n# === Security Log Monitor ===\n# สคริปต์ตรวจสอบ failed login attempts\n\nLOG_FILE="/var/log/auth.log"\nTHRESHOLD=5\n\necho "[*] Checking failed login attempts..."\n\n# นับจำนวน failed attempts ต่อ IP\ngrep "Failed password" $LOG_FILE | \\\n  awk '{print $(NF-3)}' | \\\n  sort | uniq -c | sort -rn | \\\n  while read count ip; do\n    if [ "$count" -ge "$THRESHOLD" ]; then\n      echo "[!] ALERT: $ip has $count failed attempts!"\n    fi\n  done\n\necho "[*] Check complete."	[-0.09154564,-0.17150374,-0.006612745,0.0084225265,0.12087813,-0.040218562,0.007886552,-0.013426221,0.07471643,0.12688947,0.10213516,-0.07280524,-0.020244518,0.22411783,0.00468453,0.13908863,0.08481915,-0.20980145,-0.010695877,0.1487745,0.060651477,0.06796363,-0.013994609,-0.015487625,0.014276201,0.0774149,0.003444993,0.025145443,0.058989793,-0.054088376,-0.02296019,-0.064160936,-0.02292774,-0.10171528,0.041442797,0.15724789,0.0824578,-0.012015441,5.1712617e-05,0.03715805,-0.04280392,-0.10513839,-0.047311842,0.013279883,-0.016693499,-0.16719574,-0.069842786,0.12276009,0.11673658,0.060819045,-0.046840437,0.08984875,-0.088507414,0.06863215,0.02744618,0.016252974,0.027794102,-0.03143292,0.118165374,0.011716466,0.06486645,-0.082470566,0.030406112,-0.047806714,-0.10732786,0.051986888,0.093668945,-0.038862333,-0.05034113,-0.11253947,0.03904085,0.07630041,-0.10137589,-0.03605392,0.011099386,-0.15780489,0.078675,0.06015249,-0.09072494,0.03096376,0.01959611,0.09555583,-0.018302575,-0.09438258,0.03822871,0.09808497,0.06403595,0.07317741,-0.01334111,0.038134705,0.0039385203,-0.002943709,-0.0032467747,-0.02130311,-0.032332644,0.11873998,0.04890965,0.09813152,0.15437725,0.33271277,0.06492148,0.036823686,0.07373174,0.0773888,0.028215451,-0.101982355,-0.04244695,0.057640173,0.14425275,0.14656235,-0.055766266,-0.028146304,0.07650002,0.039379083,0.30274,0.0790339,0.10008023,0.0876556,-0.021762464,0.05